import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import RetailerProductList from './RetailerProductList';

const RetailerDashboard = ({ retailer, logout }) => {
  const [activeTab, setActiveTab] = useState('products');

  return (
    <div>
      <nav className="navbar">
        <div className="nav-brand">Product Tracking using Blockchain</div>
        <div className="nav-links">
          <Link to="/" className="nav-link">HOME</Link>
          <span style={{ color: 'white' }}>Welcome, {retailer?.storeName}</span>
          <button onClick={logout} className="logout-btn">LOGOUT</button>
        </div>
      </nav>

      <div className="dashboard">
        <div className="dashboard-header">
          <h1>Retailer Dashboard</h1>
          <p>Welcome back, {retailer?.ownerName} | {retailer?.storeName}</p>
        </div>

        <div className="retailer-tabs">
          <button 
            className={`tab-btn ${activeTab === 'products' ? 'active' : ''}`}
            onClick={() => setActiveTab('products')}
          >
            Browse Products
          </button>
          <button 
            className={`tab-btn ${activeTab === 'orders' ? 'active' : ''}`}
            onClick={() => setActiveTab('orders')}
          >
            My Orders
          </button>
          <button 
            className={`tab-btn ${activeTab === 'profile' ? 'active' : ''}`}
            onClick={() => setActiveTab('profile')}
          >
            Store Profile
          </button>
        </div>

        <div className="dashboard-content">
          {activeTab === 'products' && <RetailerProductList />}
          {activeTab === 'orders' && (
            <div className="tab-content">
              <h3>My Orders</h3>
              <p>Order management coming soon...</p>
            </div>
          )}
          {activeTab === 'profile' && (
            <div className="tab-content">
              <h3>Store Profile</h3>
              <div className="profile-info">
                <p><strong>Store Name:</strong> {retailer?.storeName}</p>
                <p><strong>Owner:</strong> {retailer?.ownerName}</p>
                <p><strong>Email:</strong> {retailer?.email}</p>
                <p><strong>Phone:</strong> {retailer?.phone}</p>
                <p><strong>Address:</strong> {retailer?.address}</p>
                <p><strong>Business License:</strong> {retailer?.businessLicense}</p>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default RetailerDashboard;
